{"crew":true,"message":"From: SpaceGuard Command
SpaceGuard Command agrees to offer the pennae protection and safety inside federation space until the government has time to review his or her case.  Offer our protection and assistance if needed.

SpaceGuard Command Out","sender":"SpaceGuard Command"}

{"crew":true,"message":"FROM: SpaceGuard Command

If the national police (the Pennou) enters federation space, you are authorized to inform them that a judge will listen to both sides and make a decision.  The hearing will be at starbase 12,  invite them to participate.  

SpaceGuard Command Out","sender":"SpaceGuard Command"}

{"crew":true,"message":"FROM: USS MONTGOMERY 

